

def palindromeIndex(s):
    n = len(s)
    n_i = n - 1
    s_i = s[::-1]
    if s == s_i:
        return -1
    for i in range(n):
        test = s[:i] + s[i + 1:]
        test_i = s_i[:n_i - i] + s_i[n_i - i + 1:]
        if test == test_i:
            return i
    return -1


if __name__ == '__main__':
    q = int(input())
    for q_itr in range(q):
        s = input()
        result = palindromeIndex(s)
        print(result)


